import '../css/registration.css';
import axios from "axios";

function Registration() {
    async function Submit(data) {
        data.preventDefault();

        if (data.target[2].value.toLowerCase() !== data.target[3].value.toLowerCase())
            alert('Пароли не совпадают! Пошел нахуй!');
        return;

        response = await axios.post('http://localhost:443/auth/register');
    }

    return (
        <form className='form-registration' onSubmit={Submit}>
            <h3>username</h3>
            <input type='login'/>
            <h3>email</h3>
            <input type='email'/>
            <h3>password</h3>
            <input type='password'/>
            <h3>repeat password</h3>
            <input type='password'/>
            <button>Submit</button>
        </form>
    );
}

export default Registration;
